Mūsiškių pavardės puikuojasi šalia tokių favoritų, kaip nugalėtojo titulą ginantis Stephane'as Peterhanselis, Nasseras Al Attiyah,  Sebastienas Loebas ,  Cyrilis Despres , Mikko Hirvonenas,  Nani Roma , Carlosas Sainzas, Orlando Terranova ir kitų. Visą laikinąjį „Elito“ grupės sąrašą sudaro 27 sportininkų pavardės. Šiame sąraše atsidūrę sportininkai varžybų metu turės vadinamąją „džiokerio“ teisę, suteikiančią galimybę reabilituotis po nesėkmingo etapo – užėmus žemesnę poziciją, kitą dieną galima vis tiek startuoti iš aukštesnės vietos ir negaišti daugiau laiko lenkiant lėtesnius ekipažus. A. Juknevičiaus teigimu, tai labai svarbi detalė siekiant rezultato. Tiesa, kol kas organizatoriai pažymi, jog sąrašas yra preliminarus ir galutinai bus patvirtintas prieš prasidedant varžyboms, bet A. Juknevičius neslepia optimizmo, kad didelių pokyčių jame nebeišvysime. „Yra didelė tikimybė, kad šis sąrašas bus galutinai patvirtintas ir išliksime pasaulio elitinių pilotų sąraše bei galėsime pasinaudoti „joker“ teise. Pagrindinis jos privalumas – prasčiau pravažiavus dieną vis tiek gautume geresnę starto poziciją kitame greičio ruože. Tai ypač svarbu siekiant rezultato!“, – savo feisbuko paskyroje paskelbė „ Craft Bearings “ komandos pilotas. (function(d, s, i, r) {
